INSERT INTO `indicadores` VALUES (16960, 5, '2-634120126', 10688, 1, 8, 21600.00, 'FAMILAS BENEFICIARIAS', 'En este proyecto se priorizaron las siguientes iniciativas: diseños distrito de riego regional Popayán Tambo Timbío y Sotará; terminación del diseño Acueductos el crucero – Patía; Construcción distrito de riego por goteo ingenieros sin fronteras; Ampliación Acueducto Corrales - Piendamó para la asociación de campesinos (Anuc); Infraestructura Acueductos 2019 Municipio Piendamó con la Red de acueducto vereda Loma Corta; Mejoramiento Acueductos 2019 Municipio Toribio con el diseño del Acueducto La Laguna; Mejoramiento de Acueductos 2019 Municipio Inzá con Adecuación sistema almacenamiento de aguas en Guanacas y Mejoramiento redes de acueducto en el Guadual; Mejoramiento de Acueductos 2019 Municipio Páez con Ampliación acueducto sector las casitas vereda La María Muro de contención en concreto ciclópeo para pTAP vereda coheteando y Mejoramiento de instalaciones y red de conducción acueducto veredal Gaulcan; Mejoramiento Acueductos 2019 Municipio Cajibío con suministro de tanques de 500 lt para el abasto de la parcelación carrizal y materiales para bocatoma acueducto la Buitrera - Ricaurte y limoncito; Mejoramiento Acueductos 2019 Municipio Timbío con Micromedidores acueducto Sachacoco y Mejoramiento de la red vereda Cinco Días; Mejoramiento de Acueductos 2019 Municipio Bolívar con Mejoramiento acueducto chaguayaco; Mejoramiento Acueductos 2019 Municipio Caldono con Mejoramiento tanque la laguna impermeabilización y Mejoramiento acueducto buitrera tubería; Mejoramiento Acueductos 2019 Municipio Rosas con mejoramiento del acueducto el Sauce; Mejoramiento Acueductos 2019 Municipio el Tambo con mejoramiento de viaductos en acueducto los cedros adecuación y ampliación del acueducto de montaña tubería para el acueducto Gualeito – Anayes - Seguengue y construcción tanque de almacenamiento vereda la laja - asuchim.; Mejoramiento Acueductos 2019 Municipio Patía con Mejoramiento alcantarillado vereda la floresta y Mejoramiento de Acueductos 2019 Municipio Suarez con mejoramiento bocatoma de succión del acueducto veredal Damián.', '2019');
